import React, { Component } from "react";
import ListItem from './ListItem.jsx';
import './App.css';

export default class List extends Component {
    render() {
        const pieces = [["Piece1", "/images/Piece1.jpg", "oil paint"],
        ["Piece2", "/images/Piece2.jpg", "colored pencil"], ["Piece3", "/images/Piece3.jpg", "watercolor"]];
        const listpiece = pieces.map((piece) =>
            <ListItem name={piece[0]} src={piece[1]} medium={piece[2]} />
        );
        return <div class="image">{listpiece}</div>;
    }
}
